import{_ as a,c as t,a2 as r,o as s}from"./chunks/framework.cddoPPhG.js";const m=JSON.parse('{"title":"Glossary","description":"","frontmatter":{},"headers":[],"relativePath":"glossary.md","filePath":"glossary.md","lastUpdated":1728675848000}'),l={name:"glossary.md"};function i(n,e,h,o,u,d){return s(),t("div",null,e[0]||(e[0]=[r('<h1 id="glossary" tabindex="-1">Glossary <a class="header-anchor" href="#glossary" aria-label="Permalink to &quot;Glossary&quot;">​</a></h1><p>Here you can find all the words used in this documentation, which might be unfamiliar to the common user. Especially all German words used in the context of the project will be explained here. The glossary uses the female form of nouns when talking about people to make it easier to read and understand for non-German readers. When using the female form, this is not meant to be exclusive, the definitions are applicable to male and non-binary people as well.</p><h3 id="auszubildende" tabindex="-1">Auszubildende <a class="header-anchor" href="#auszubildende" aria-label="Permalink to &quot;Auszubildende&quot;">​</a></h3><p>A person who is in a &quot;Duale Berufsausbildung&quot;, a German educational concept where you learn theoretical concepts at a &quot;Berufsschule&quot;, which is an educational institute comparable to vocational schools. The practical concepts are taught at a specific company that the <a href="./glossary.html#auszubildende">Auszubildende</a> has a contract with</p><h3 id="dienststelle" tabindex="-1">Dienststelle <a class="header-anchor" href="#dienststelle" aria-label="Permalink to &quot;Dienststelle&quot;">​</a></h3><p>A <a href="#dienststelle">Dienststelle</a> is the department from which the <a href="#praktikumsstelle">Praktikumsstelle</a> is reported in our context and in which the <a href="#nachwuchskraft">Nwks</a> will then work.</p><h3 id="lehrjahr" tabindex="-1">Lehrjahr <a class="header-anchor" href="#lehrjahr" aria-label="Permalink to &quot;Lehrjahr&quot;">​</a></h3><p>Training year, only for <a href="#auszubildende">Auszubildende</a></p><h3 id="meldezeitraum" tabindex="-1">Meldezeitraum <a class="header-anchor" href="#meldezeitraum" aria-label="Permalink to &quot;Meldezeitraum&quot;">​</a></h3><p>A <a href="./glossary.html#meldezeitraum">Meldezeitraum</a> is a time range in which <a href="./glossary.html#ortliche-ausbilderin">örtliche Ausbilderinnen</a> can report <a href="./glossary.html#praktikumsstelle">Praktikumsstellen</a> to the <a href="./glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitung</a>. All <a href="./glossary.html#praktikumsstelle">Praktikumsstellen</a> reported during a certain <a href="./glossary.html#meldezeitraum">Meldezeitraum</a> are linked to this specific <a href="./glossary.html#meldezeitraum">Meldezeitraum</a></p><h3 id="nachwuchskraft" tabindex="-1">Nachwuchskraft <a class="header-anchor" href="#nachwuchskraft" aria-label="Permalink to &quot;Nachwuchskraft&quot;">​</a></h3><p>Long form of <a href="./glossary.html#nwk">Nwk</a></p><h3 id="nwk" tabindex="-1">Nwk <a class="header-anchor" href="#nwk" aria-label="Permalink to &quot;Nwk&quot;">​</a></h3><p><a href="./glossary.html#nwk">Nwk</a> is short for <a href="./glossary.html#nachwuchskraft">Nachwuchskraft</a> and is a term referring to <a href="./glossary.html#auszubildende">Auszubildenden</a> and <a href="./glossary.html#studentin">Studentinnen</a>.</p><h3 id="ortliche-ausbilderin" tabindex="-1">Örtliche Ausbilderin <a class="header-anchor" href="#ortliche-ausbilderin" aria-label="Permalink to &quot;Örtliche Ausbilderin&quot;">​</a></h3><p>A <a href="./glossary.html#ortliche-ausbilderin">örtliche Ausbilderin</a> is person who is responsible for the education of an <a href="./glossary.html#nwk">Nwk</a> at their team at the company. Their job is to give small work items to them and help them if necessary. The <a href="./glossary.html#ortliche-ausbilderin">örtliche Ausbilderin</a> is the first contact person if an <a href="./glossary.html#nwk">Nwk</a> needs help.</p><h3 id="ortliche-ausbildungsleitung" tabindex="-1">Örtliche Ausbildungsleitung <a class="header-anchor" href="#ortliche-ausbildungsleitung" aria-label="Permalink to &quot;Örtliche Ausbildungsleitung&quot;">​</a></h3><p>The <a href="./glossary.html#örtliche-ausbildungsleitung">örtliche Ausbildungsleitung</a> is responsible for the education of <a href="./glossary.html#nwk">Nwk</a> in a larger part of the company. They coordinate which <a href="./glossary.html#nwk">Nwk</a> is assigned to which <a href="./glossary.html#praktikumsstelle">Praktikumsstelle</a>. They are also the contact person if a <a href="./glossary.html#nwk">Nwk</a> has any problems with their <a href="./glossary.html#ortliche-ausbilderin">örtliche Ausbilderin</a>. In the first iterations of development, they were the main users of this application.</p><h3 id="planstelle" tabindex="-1">Planstelle <a class="header-anchor" href="#planstelle" aria-label="Permalink to &quot;Planstelle&quot;">​</a></h3><p>A <a href="./glossary.html#planstelle">Planstelle</a> is the abstract concept of a position in a team, a current <a href="./glossary.html#nwk">Nwk</a> could work at in the future after finishing their training.</p><h3 id="praktikumsstelle" tabindex="-1">Praktikumsstelle <a class="header-anchor" href="#praktikumsstelle" aria-label="Permalink to &quot;Praktikumsstelle&quot;">​</a></h3><p>A <a href="./glossary.html#praktikumsstelle">Praktikumsstelle</a> is an abstract concept that describes a position in a team where a <a href="./glossary.html#nwk">Nwk</a> can work and be educated.</p><h3 id="studentin" tabindex="-1">Studentin <a class="header-anchor" href="#studentin" aria-label="Permalink to &quot;Studentin&quot;">​</a></h3><p>Just the German translation of student, so someone studying at a university or similar institution, with the goal of gaining a bachelor&#39;s or master&#39;s degree.</p><h3 id="zuweisungszeitraum" tabindex="-1">Zuweisungszeitraum <a class="header-anchor" href="#zuweisungszeitraum" aria-label="Permalink to &quot;Zuweisungszeitraum&quot;">​</a></h3><p>A <a href="./glossary.html#zuweisungszeitraum">Zuweisungszeitraum</a> is a time range, in which <a href="./glossary.html#nwk">Nwks</a> are working at the <a href="./glossary.html#praktikumsstelle">Praktikumsstellen</a> they were assigned to.</p>',26)]))}const f=a(l,[["render",i]]);export{m as __pageData,f as default};
